import React from "react";

export default function AlpineMotion() {
  return (
    <>
      <section className="alpineMotion-layout">
        <div className="alpineMotion-container">
          <img alt="" src="./img/superveloceAlpine/44-bg-motion.svg"></img>
          <span>The incredible union of MV Agusta and Alpine</span>
          <h3>HISTORY OF MOTORSPORT …IN MOTION</h3>
          <p>
            Inspired by Alpine’s A110, MV Agusta Superveloce Alpine’s 110-units
            limited series is a tribute to French and Italian racing and design
            genius.
          </p>
          <a href>WATCH</a>
        </div>
      </section>
    </>
  );
}
